import styled from "styled-components";

export const BackgroundRoot = styled.div`
  background-image: url("https://rb.gy/zhak3r");
  width: 100%;
  position: absolute;
  
`;

export const CardBorder =styled.div`
  border-radius: 30px;
  background-color: white;
  width: 30%;
  padding-bottom: 20px;
  text-align: center;
  position: relative;
`;
